import React from "react"
import './FoodPost.scss'
const FoodPost = ({ post }) => {
  
  return (
    <div className="food__post">
      <img src={post.imgThumb} alt={post.title} />
      <h4>{post.title}</h4>
    </div>
  )
}
export default FoodPost
